import layout from "../../styles/layout.module.css";

const Layout = () => {
  return (
    <div className={layout.containerLayout}>
      <Link to="/anuncios">
        <div className={layout.imageContainer}>
          <img className={layout.logoLayout} src={Logo} alt="LogoApp"></img>
        </div>
      </Link>
    </div>
  );
};

export default Layout;
